import { Component } from "react";

export class PostContainer extends Component {
	constructor(props) {
		super(props);
	}

	render() {
		const { posts } = this.props;

		return (
			<article className="post-container" >
				<h2>{posts.id}</h2>
				
			</article>
		);
	}
}
